  false,\n\t\"url\": null,\n\t\"notes\": \"Data for medium and high voltage transmission
  lines were compiled for the AICD study led by the World Bank. A variety of sources
  were consulted, including regional power pool documents and maps from World Bank
  project documents. Locations are approximate, intended to reflect main connections,
  and are not representative of actual \"path on the ground\". The following attributes
  were collected: VOLTAGE_KV: Transmission line capacity in kilovolts, FROM_NM: Name
  of the locality where the link starts, TO_NM: Name of the locality where the link
  ends, STATUS: Status of link (Existing, Planned, Proposed, Under Study), SOURCES:
  Source of location or attribute information, PROJECT_NM: Name of project (planned
